Утренняя сводка от Минобороны

Враг потерял:
▪️5 российских истребителей под Васильковом и Броварами (2 сбили летчики, 3 - ракетные дивизионы С-200);
▪️1 крылатую ракета и 1 вертолет под Киевом;
▪️бронетехнику и живую силу на Киевщине и Житомирщине;
▪️танк и два зенитро-ракетных комплекса "БУК" (поработал Bayraktar TB2).
А также получил четыре сокрушительных бомбовых удара по танковым колоннам, колоннам механизированной техники, автоколонне с горюче-смазочными материалами на Черниговщине и близ Бердянска.

Голова Харківської обласної військової адміністрації Олег Синєгубов вранці 28 лютого:

▪️ Всю ніч відбивали  наступ, знищували колони вже на підходах до позицій ще до того, як вони змогли завдати артилерійських обстрілів міста;
▪️ Місто під контролем;
▪️ Велика кількість диверсійних груп;
▪️ Вчора вся техніка, яка зайшла в Харків, була знищена, понад 20 диверсантів були заблоковані у школі, їх знищено;
▪️ Був випадок, коли одному українському військовому здалися семеро російських військових;
▪️ Люди добровільно надають автівки нашим військовим;
▪️ Розгортатимуть кілька логістичних центрів, щоб розподіляти продукти;
▪️ Є ризики наступу диверсійних груп;
▪️ Є загиблі серед дітей;
▪️ Сьогодні комендантська година буде з 15:00 до 6:00;
▪️ Мітка не означає, що в будинок прилетить снаряд, люди активно знімають мітки.

