Актуальные правила въезда в Польшу из Украины
⠀⠀⠀⠀⠀⠀⠀⠀⠀
1. В Польшу можно въехать без заграничного паспорта;
2. В Польшу можно въехать по безвизу (без подачи на беженство);
3. Можно въехать по внутреннему паспорту. Детям с свидетельством о рождении;
4. После пересечения границы по внутреннему паспорту вы должны подать заявление на получение международной защиты (беженство). Паспорт будет изъят на время рассмотрение дела;
5. Граждане других стран (иностранцы) также могут въехать в Польшу, подав заявление на предоставление международной помощи без действующей визы (только с паспортом);
6. Отрицaтельные тесты не нужны;
7. Каpaнтин проходить не нужно;
8. Для тех, кто написал заявление на предоставление международной помощи будет предоставлено жильё в специальных лагерях, от него можно отказать и уехать к знакомым / друзьям / родным;
9. При пересечении границы с животным без паспорта, достаточно указать в декларации "zgodnie z procedura nadzwyczajna", после въезда в Польшу вам выдадут документы;
10. Военнообязанных мужчин и резервистов из Украины не выпускают;
11. Детей без согласия второго родителя пропускают на 30 дней (информация неофициальная), лучше всего иметь доверенность;

Інформація щодо укриття населення міста.

Ознайомитися з місцями розміщення укриттів для населення можна на "Геопорталі Харкова"

1. Щоб дізнатися про найближчі укриття необхідно:
- перейти за посиланням https://smart.gis.digital/opendataportal/;
- ввести позначку у вкладці «Укриття» та активувати відповідний шар карти;
- закрити перелік шарів карти та перейти до шару карти «Укриття»;
- шляхом введення адреси або вручну визначити на карті своє місцеперебування, та знайти найближчій об’єкт, де облаштовано укриття.

2. Щоб визначити укриття, до якого приписані (укриваються) мешканці відповідного житлового будинку, необхідно:
- виконати перші три кроки пункту 1;
- шляхом введення адреси або за вручну знайти свій житловий будинок на карті;
- натиснути на відповідний житловий будинок;
- в інформаційній довідці, яка з’явиться на екрані, натиснути кнопку «укриття»;
- на інтерактивній карті визначиться місце розташування та найменування укриття, до якого приписані (укриваються) мешканці даного житлового будинку.                                                                                                                            Якщо немає доступу в укриття телефонуйте 15-62.
